class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      text: props.text_list,
      flag: true,
      color_flag: Array(props.text_list.length).fill(false),
    };
  }

  render() {
    return (
      <div>
        <div className="word_list">
          <ol className="ol_label">
            {this.state.text.map((value) => (
              <li>
                <div>{value}</div>
                <CheckBox />
              </li>
            ))}
          </ol>
        </div>
      </div>
    );
  }
}

export default App;
